class Solution {
public:
    bool isSubsequence(string s, string t) {
        if (s.empty()) return true;
        int i=0;
        for (const char & c : t){
            if (i < s.size()){
                if (c == s[i]) i++;
            }else{
                return true;
            }
            
        }
        return i==s.size();
    }
};
